import React from 'react'
import { FaFacebook, FaInstagram, FaTwitter } from 'react-icons/fa'
import { footer, navData } from '../global/Data'

function Footer() {
  return (
    <section className='lg:pt-[50px] bg-gray-100'>
      <div className='container mx-auto'>
        <div className='flex flex-col px-32 py-10 justify-between h-[300px]'>
          <div>
            <img src={navData.image} alt="" />
          </div>
          <div className='flex-1 mt-6'>
            {footer.word}
          </div>
          <div className='flex flex-row'>
            <FaFacebook style={
              {
                color: 'red',
                fontSize: '30px'
              }
            }
            className = "shadow-lg"
            />
            <FaTwitter style={
              {
                color: 'red',
                fontSize: '30px'
              }
            }
            className = "shadow-lg"
            />
            <FaInstagram style={
              {
                color: 'red',
                fontSize: '30px'
              }
            }
            className = "shadow-lg"
            />
          </div>
          <div className='mt-6 text-gray-400'>
            {footer.copyRight}
          </div>
        </div>
      </div>
    </section>
  )
}

export default Footer
